const Header = () => {
    const [cart, setcart] = useState("0");



    return(
    <header className = "sticky-top">
        <nav className="navbar  bg-white mb-0 " >
            <div className="container-fluid px-0 px-xl-2">
            </div> 
        </nav>
        <div id="black-bar" className ="d-none d-xl-block sticky-top" ></div>
    </header>) 
}
export default Header;
